            "profile_photo_url" : "https://lh5.googleusercontent.com/-HjNZuTEgoX8/AAAAAAAAAAI/AAAAAAAAAKc/dqjItLhD1MM/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 weeks ago",
            "text" : "The building itself is very impressive and very modern looking. It was free to enter the viewing area which offered a breathtaking view of Hamburg and included a gift shop and restaurant. To get to the viewing area you need to take an interesting escalator ride up over six floors at a low angle of assent.",
            "time" : 1493510045
         },
         {
            "author_name" : "Lei Zhang",
            "author_url" : "https://www.google.com/maps/contrib/118323164144448118879/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-RAf1Po6TxRo/AAAAAAAAAAI/AAAAAAAAAHk/sNCA9boX9QY/s128-c0x00000000-cc-rp-mo-ba1/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Finally! Regardless all the downsides, it is a piece of masterpiece! Wish to have a concert here. Will keep an eye on the ticket webpage.\n\nAlso, remember how many tourists have visited Sydney after the Opera House was finished? Hamburg will do the same and perhaps will do a lot better. \n\nPS: the view from the Plaza is fantastic!",
            "time" : 1492381098
         },
         {
            "author_name" : "Muhammad Ejle",
            "author_url" : "https://www.google.com/maps/contrib/107019769963337078612/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-2rvtZanmUfI/AAAAAAAAAAI/AAAAAAAAAmw/04e4R8b3mw4/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "A contemporary architectural mecca. If you're an architect (it's ok if you're not) you should experience this place.. I recommend the free entrance to the plaza, it's definitely worth it.   ",
            "time" : 1494630216
         },
         {
            "author_name" : "Trang Nguyen",
            "author_url" : "https://www.google.com/maps/contrib/111317664461491686165/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-5sfA1AmmBhY/AAAAAAAAAAI/AAAAAAAAAAA/AHalGhpc20rWAaoPVHgmmgEzbzx4AyBI6g/s128-c0x00000000-cc-rp-mo-ba1/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "The place has amazing architecture and incredible views over Hamburg! It's free to enter so once you get to the venue line up for the free tickets ASAP. During peak times you may have to wait for the ticket desk to hand out tickets or you may have to wait for your time at the turnstiles. The wait is worth it to experience the magical ride up the escalators. There are so many instagram-worthy snaps and if you would like to extend your stay you can dine there as well. Note that during winter it is cold as it becomes practically an open space due to the large volumes of people walking in and out of the plaza.",
            "time" : 1487023995
         },
         {
            "author_name" : "Alexander A. Plagge",
            "author_url" : "https://www.google.com/maps/contrib/102231563798531638093/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-GHyW7rAnQJo/AAAAAAAAAAI/AAAAAAAAAC0/8rDQdO5jl8g/s128-c0x00000000-cc-rp-mo-ba1/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "Expensive and years late. Tarnished the reputation of German engineering... That is all true, but nevertheless the final result is awesome! Hamburg got a great new attraction. Great view from the plaza. Get tickets before on their website for EUR2/person to avoid the long cue.",
